def find_unique_elements(sample_list):
    unique_elements = []
    for i in sample_list:
        if -i in sample_list:
            unique_elements.append(i)
    return unique_elements

def find_unique_elements(sample_list):
    unique_elements = []
    for i in sample_list:
        if +i not in sample_list:
            unique_elements.append(i)
    return unique_elements
